import React from "react"
import ReactDOM from "react-dom"

const link1="https://www.youtube.com/watch?v=gdZLi9oWNZg";
const link2="https://www.youtube.com/watch?v=XsX3ATc3FbA";
const link3="https://www.youtube.com/watch?v=B5CFyri4dLg";
const link4="https://www.youtube.com/watch?v=-5q5mZbe3V8";
const link5="https://www.youtube.com/watch?v=7UWBYJjuIL0";


ReactDOM.render(
  <>
  <h1>Bts Songs</h1>
  <p> My Favirot Songs</p>
  <ol>
        <a href={link1} target="_blank"><li> Dynamite </li></a>
        <a href={link2} target="_blank"><li> Boy with luv </li></a>
        <a href={link3} target="_blank"><li> Pied piper </li></a>
        <a href={link4} target="_blank"><li> Life goes on </li></a>
        <a href={link5} target="_blank"><li> We are Bulletproof </li></a>
  </ol>
  </>,
  document.getElementById('root')
);
